import{_ as e,c as a,o as r,d as t}from"./app.29112e6d.js";const m='{"title":"FAQ","description":"","frontmatter":{},"headers":[{"level":2,"title":"FAQ","slug":"faq"}],"relativePath":"faq.md","lastUpdated":1641609717135}',o={},n=t('<h2 id="faq" tabindex="-1">FAQ <a class="header-anchor" href="#faq" aria-hidden="true">#</a></h2><h4 id="do-i-need-to-buy-any-google-subscription-for-teamone" tabindex="-1">Do I need to buy any Google subscription for TeamOne? <a class="header-anchor" href="#do-i-need-to-buy-any-google-subscription-for-teamone" aria-hidden="true">#</a></h4><p>No. Even a free gmail account would work for individual licenses. Though if you purchase a Google Workspace plan, you will be able to install TeamOne for all your users.</p><h4 id="does-any-server-side-software-need-to-be-installed" tabindex="-1">Does any server side software need to be installed? <a class="header-anchor" href="#does-any-server-side-software-need-to-be-installed" aria-hidden="true">#</a></h4><p>For most of the TeamOne functionality no server side software is required to install. However if you install <strong>TeamOne Agent</strong> you will get additional features, like server health status data (RAM, CPU, disk size).</p><h4 id="will-any-of-my-data-be-sent-or-stored-on-any-3rd-party-servers" tabindex="-1">Will any of my data be sent or stored on any 3rd party servers? <a class="header-anchor" href="#will-any-of-my-data-be-sent-or-stored-on-any-3rd-party-servers" aria-hidden="true">#</a></h4><p>TeamOne stores temporary data using <a href="https://en.wikipedia.org/wiki/HTTP_cookie" target="_blank" rel="noopener noreferrer">cookies</a>. No data is being sent or stored on any servers.</p><h4 id="what-tm1-ibm-planning-analytics-version-is-supported" tabindex="-1">What TM1 \\ IBM Planning Analytics version is supported <a class="header-anchor" href="#what-tm1-ibm-planning-analytics-version-is-supported" aria-hidden="true">#</a></h4><p>Even though some functionality may work in the older versions, TeamOne add-on officially supports version IBM Planning Analytics 2.0.5 or newer.</p><h4 id="which-tm1-integratedsecuritymode-does-teamone-support" tabindex="-1">Which TM1 IntegratedSecurityMode does TeamOne support? <a class="header-anchor" href="#which-tm1-integratedsecuritymode-does-teamone-support" aria-hidden="true">#</a></h4><p>TeamOne supports the next TM1 integrated security modes: 1, 4, 5. If you don&#39;t specify <strong>namespace</strong> property of your environment definition, it will use mode 1 for connecting to TM1.</p><hr><p>Succeedium\xAE TeamOne 2022 | <a href="https://succeedium.com/teamone/privacy" target="_blank" rel="noopener noreferrer">Privacy Policy</a> | <a href="https://succeedium.com/teamone/terms" target="_blank" rel="noopener noreferrer">Terms Of Service</a></p>',13),s=[n];function i(d,l,c,h,p,u){return r(),a("div",null,s)}var y=e(o,[["render",i]]);export{m as __pageData,y as default};
